USE INSERT_EXCEL_2;

CREATE TABLE CIDADES (
  CODIGO_CIDADE INTEGER NOT NULL,
  NOME_CIDADE VARCHAR(100) NOT NULL,
  ESTADO VARCHAR(2) NOT NULL,
  ADOLESCENTE_NA_ESCOLA FLOAT(4,2),
  FREQUENTANDO_FACULDADE FLOAT(4,2),
  POPULACAO_TOTAL INTEGER,
  POPULACAO_URBANA  INTEGER,
  POPULACAO_RURAL  INTEGER,
  POPULACAO_ADOLESCENTES INTEGER,
  POPULACAO_JOVEM INTEGER,
  POPULACAO_ADULTOS INTEGER,
  SOBREVIVENCIA_40_ANOS FLOAT(4,2),
  SOBREVIVENCIA_60_ANOS FLOAT(4,2),
  IDH FLOAT(4,2),
  PRIMARY KEY (CODIGO_CIDADE) );



